import { Link, useNavigate } from "react-router-dom";

const Products = () => {
    const navigate = useNavigate();
    return (
        <div>
            <h1>This is The Product Page</h1>
           <ul>
            <li>Product 1</li>
            <li>Product 2</li>
            <li>Product 3</li>
           </ul>
        </div>
    );
};
export default Products;
